style.css:
@-moz-document domain("www.matematikfessor.dk")
{
  .fessorLevelIllustration img
  {
    content: url(https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRx_ddkV4wo4QzpSkQSimGpmhD7AofiQtWhwt399XRJYMmp0r2u);
  }

  .fessorLevelIllustration> h3:after
  {
    content: 'Morten Fessor';
    visibility: visible;
    display: block;
    position: absolute;
    z-index: 2;
    top: 0;
    left: .2em;
    font-family: Schoolbell, 'Comic Sans MS', sans-serif;
    font-size: 1.1em;
    line-height: 1.1em;
    color: #0000ff;
  }

  .fessorLevelIllustration> h3
  {
    visibility: hidden;
  }
}
